func TestDeregister(t *testing.T) {
	client := NewController("admin", "percona")
	defer removeAllDeregistered(client)

	err := client.Unregister(engine.DeregistrationRequest{
		 "test",
		engine.ShardDeregistrationRequest{
			engine.ReplicaDeregistrationRequest{engine.HowUnsafe, 0},
			engine.ReplicaDeregistrationRequest{engine.HowSafe, 1},
			engine.ReplicaDeregistrationRequest{engine.HowUnsafe, 2},
		},
		false,
	})
	if err != nil {
		t.Errorf("Unregister Error: %v", err)
	}
	expectedDeregistered := []engine.DeregistrationResult{
		{"test",
			engine.ShardDeregistrationResult{
				engine.ReplicaDeregistrationResult{true, nil},
				engine.ReplicaDeregistrationResult{true, nil},
				engine.ReplicaDeregistrationResult{true, nil},
			},
			false,
			nil,
		},
	}
	compareResults(client, t, expectedDeregistered)
}

